// Category-menu mobile
// --------------------------

(function () {
    var categoryMenu = document.querySelector('.nav-category__list-js');
    var categoryMenuItem = categoryMenu.querySelectorAll('.nav-category__item');

    var dropDown = Array.from(categoryMenuItem);

    var handlerClick = function handlerClick(e) {
        e.preventDefault();

        if (e.currentTarget.classList.contains('active')) {
            e.currentTarget.classList.remove('active');
        } else {

            dropDown.forEach(function (node) {
                node.classList.remove('active');
            });

            e.currentTarget.classList.add('active');
        }
    };

    dropDown.forEach(function (node) {
        node.addEventListener('click', handlerClick);
    });
})();

// Sign-in form
// --------------------------

(function () {
    var signInBtn = document.querySelector('.sign-in-js');
    var signInForm = document.querySelector('.sign-in__form-wrap-js');
    var headerTop = document.querySelector('.header-top-wrap');

    signInBtn.addEventListener('click', function () {
        headerTop.classList.toggle('open');
    });

    window.addEventListener('click', function (event) {
        if (!signInForm.contains(event.target) && !signInBtn.contains(event.target)) {
            headerTop.classList.remove('open');
        }
    });
})();

// Sign-in/forgot form switch
// --------------------------

(function () {
    var switchBtn = document.querySelector('.forgot-password-js');
    var switchBtnBack = document.querySelector('.forgot-password-back-js');
    var signInForm = document.querySelector('.sign-in__form-hide-js');
    var forgotForm = document.querySelector('.forgot-password__form-hide-js');

    switchBtn.addEventListener('click', function () {
        signInForm.style.display = 'none';
        forgotForm.style.display = 'block';
    });

    switchBtnBack.addEventListener('click', function () {
        forgotForm.style.display = 'none';
        signInForm.style.display = 'block';
    });
})();


// Show more/less
// --------------------------

(function () {
    var showMoreLess = document.querySelector('.articles-more-less-js');

    if (showMoreLess) {
        showMoreLess.addEventListener('click', function () {
            showMoreLess.classList.toggle('more');
        });
    }
})();
